    "chp": "01",
    "id": "37",
    "graphic": "CH1_034.jpg",
    "desc": "1.33. Casa Rinconada, Pueblo Bonito and its mounds, andthe suggested axis linking these two ancestral Puebloan structures. Plan by Stephen H. Lekson,1992. Unlike the kivas of unit houses or the kivas within a Great House such as Pueblo Bonito, CasaRinconada stands in isolation. If, however, one takesinto account an axis running from CasaRinconada through the two large rectangular mounds atthe southern edge of Pueblo Bonito inalignment with the wall that bisects it into an eastern and awestern half, it is apparent that a linkage was intended. Themounds once had strong masonry retaining walls and a flatplastered surface on top, giving them greater architecturalimportance than that of a typical ancient unit house. Perhapsthey were used ritually as ceremonial platforms. In any case,they are the vertical inverse of the sunken architecture withinPueblo Bonito. Not only do theyheighten the feeling of its enclosure, but they also dramatizethe approach from, and connection to, CasaRinconada. Similar mounds, which are not typicalmidden or refuse mounds but often contain broken ceramicspossibly associated with ritual ceremonies, are found at PuebloAlto and at many outlier sites.",
    "short": "Casa Rinconada",
