    "graphic": "CH1_038.jpg",
    "desc": "1.37. Serpent Mound, Locust Grove, Ohio. c. 1000&#x2013;1140 c.e. The architects who laid out Great Serpent Moundfitted the writhing body of their nearly quarter-mile longreptile into the curve formed by the creek and its adjacentbluff. The oval form that appears to protrude from the snake'smouth can be read as an egg.",
    "short": "Serpent Mound, Ohio",
