    "chp": "02",
    "id": "44",
    "graphic": "CH2_002.jpg",
    "desc": "2.1. The Athenian Acropolis with the olive tree planted to commemorate the presence in antiquity of Athena's sacred tree. Itstands in the courtyard of the Erechtheion where it is believed thata charred olive tree managed to sprout leaves, bringing hope ofrenewal and rebirth of the Athenian polisafter the Persians had burned and razed the buildings of theAcropolis in 480 b.c.e. The Erechtheionhoused a xoanon, the ancient cult statue ofAthena. The caryatids that form the columns of its south porchoverlook the fire-scarred foundation stones of the Old Temple ofAthena. Although the Acropolis was rebuilt later in the fifthcentury b.c.e. by Pericles, and the Parthenon became the majesticreplacement of the destroyed temple, its site was always consideredby Athenians to be hallowed ground.",
    "short": "Athenian Acropolis",
