    "chp": "02",
    "id": "52",
    "graphic": "CH2_010.jpg",
    "desc": "2.9. Plan of Miletus. Miletus was laid out in the 5th century b.c.e. as two grids, the more finely texturedone with smaller street blocks to the north, and a looser-grained gridwith two intersecting principal axes to the south. A band of publicspaces containing various temples and a large agora traversed the townbetween the two grid sections. Descending from the Lion Harbor, whichdeeply penetrated the northern section of the city, was another arm ofpublic space, and it, too, contained an agora. A long L-shaped stoa fronted impressively on the Lion Harbor. Itwas backed by another L-shaped stoa facing thetown on the east. Additional stoas made thisagora in effect a peristyle court. By the middle of the 2nd century b.c.e., the considerably larger southern agoraof Miletus had been similarly formed by the conjunction of independentstoas. A Lion Harbor.B Northern Agora. CTheater. D Southern Agora",
    "short": "Miletus",
