    "desc": "Left: 2.14. Drawing of the restored Monument of the Eponymous Heroes, c. 330 b.c.e. In front of the monument was a barrier of stoneposts and wooden railings. Here a citizen could read the civicnotices posted beneath the figure representing his tribe. Here alsogeneral announcements, including drafts of proposed legislation,were posted. The Monument of the Eponymous Heroes was thus animportant information center in ancient Athens, functioning much like the modern press infocusing debate on public issues.",
