    "chp": "02",
    "id": "72",
    "graphic": "CH2_030.jpg",
    "desc": "Below: 2.28. Fountain, House of the Little Fountain, Pompeii. 1st century c.e. In order to enjoy the abundance ofwater available in the Imperial Age, Pompeians built showy mosaicfountains. These often took the form of a small pedimented structurecontaining a semicircular niche. Inside the niche, water cascadeddown a miniature staircase or spouted from a jet held by, orcontained within, a sculpture. The mosaics that decorated thesefountains were formed of sea shells and brilliantly coloredtiles.",
    "short": "House of the Little Fountain, Pompeii",
