    "chp": "02",
    "id": "76",
    "graphic": "CH2_034.jpg",
    "desc": "Right: 2.32. House and Garden of Octavius Quartio (formerly called the House of Loreius Tiburtinus), Via dell'Abbondanza, Pompeii. 3rd century b.c.e., remodeled with garden extension afterearthquake in 62 c.e. This handsomehouse, with its large garden stretching the length of the block,was located near the amphitheater. It was converted into an inn,as were other fine old homes in the vicinity during theeconomically declining years preceding the catastrophe of 79 c.e. when Pompeii was buried under a rain of volcanic ash fromthe eruption of Mount Vesuvius.Besides serving as a hotel for the visitors who came to see thegladiatorial games at the amphitheater, it offered, as a modernhotel might, a hospitable place to give a party when one did nothave a large enough house in which to entertainfriends.",
