    "graphic": "CH2_039.jpg",
    "desc": "2.37. Plan of Villa of Poppaea, Oplontis, a residental suburb of Pompeii (modern Torre Annunziata). 1stcentury b.c.e. with rebuilding andreplanting of garden after earthquake in 62 c.e. Within the garden is a diagonal pathway, which ispresumably mirrored by a corresponding diagonal path now buriedunder the pathway along the western edge of the villa. The twodiagonal paths would have met a central path at a point that liesunder the as-yet-unexcavated volanic debris. It is logical that twoother diagonal paths radiated from this point, making the gardenrectangular in shape.",
