    "graphic": "CH2_046.jpg",
    "desc": "2.44. Plan of Scenic Canal and Triclinium, also called the Canopus. 118&#x2013;138c.e. The northwest end of thecanal is semicircular. Sculptures placed between columns andpergolas lined the long sides of this canal set within a drawwith steep terraced embankments. Its axis was terminated in thelarge half-dome at the southeast end. This impressive structure,its interior wall once encrusted with mosaic and undulating in aseries of alternating radial gores, served as the backdrop for astibadium, a semicircular diningcouch (fig. 2.43). This stibadium wasrimmed with water, and circular sockets near its base heldbronze serving tables. In front of it was space for additionalwooden dining couches; these faced a semicircular pool uponwhich servants floated banquet dishes.",
