    "chp": "03",
    "id": "118",
    "graphic": "CH3_028.jpg",
    "desc": "Below: 3.25. Schematic plan for the monastery at St. Gall, Switzerland, c. 819. Drawing after a 9th-century manuscript illustration. Near the lower right-hand corner is a vegetable garden with eighteen rectangular beds carefully labeled with the names of various types of produce. Next to this garden lay the cemetery, which was also the orchard. The herb garden in the upper right-hand corner of the plan is located logically next to the infirmary. Until the rise of medical schools in the late Middle Ages, when a new professional class tried to outlaw the practice of monastic medicine, monks acted as physicians not only within their own communities but also to patients from outside the monastery. The medicines that they and the trained doctors who were their successors used were herbal ones, and the pharmacopoeia they derived from plants was extensive.",
    "short": "monastery at St. Gall, Switzerland",
    "match": null,
    "options": [],
    "text": null,
    "zoteroID": null,
    "zoteroURL": null
