    "id": "169",
    "graphic": "CH4_049.jpg",
    "desc": "4.47. Plan of Paris by Michel Turgot. 1734. Because of a draftingerror that failed to account for a slight discrepancy in scale whenearlier drawings of the Louvre and Tuileries were amalgamated into anew plan of spatial unification, the axes of the two palaces weremisaligned. But this problem only became noticeable in thenineteenth century when the intervening structures remaining frommedieval Paris were removed. If the axisof the Louvre had been congruent with that of the Tuileries, theLouvre's new entrance, the Pyramid designed by I.M. Pei, would be aligned with the Arc de Triomphe andother important monuments that punctuate the ChampsElys&#x00E9;es.",
    "short": "Plan of Paris by Michel Turgot",
