    "chp": "04",
    "id": "175",
    "graphic": "CH4_055.jpg",
    "desc": "4.53. Plan of Luxembourg Gardens drawn before 1627. Though JacquesBoyceau's role in the creation of the Luxembourg Gardens for Marie deM&#x00E9;dicis cannot be proved, a certain designmaturity is evident here. There is a fine sense of proportion in therelationship of path width to parterre andpalissade, a generosity of scale, themanipulation of the ground plane for optical effect, calculateddiversity within a framework of carefully balanced symmetry, and theuse of eye-catching features&#x2014;fountains, sculpture, orangetrees in boxes, balustrades, and stairs&#x2014;to break up spacewith rhythmical accents, thereby creating measurability.",
    "short": "Plan of Luxembourg Gardens",
