    "chp": "05",
    "id": "189",
    "graphic": "CH5_013.jpg",
    "desc": "5.12. Isra&#x00EB;l Silvestre'ssuites of engravings of the memorable F&#x00EA;tes de Versailles(Paris: Les Plaisirs de L'Isle Enchant&#x00E9;e, 1673) provide a fine example ofVersailles' ability to accommodate theatrical spectacle. Theengravings depict the entertainments that both glorified the kingand demonstrated his power. The first celebrated his alliance withhis mistress, Louise de LaValli&#x00E8;re, during five days at the beginning of May 1664, The marriage of nature andstagecraft is apparent in several tableaux of various events and isdiscernible even in a banqueting scene, where torchbearers form aline of \"footlights\" in front of the guests, while, behind them,costumed waiters hold aloft trays of mounded delicacies as they movewith balletic grace and precision in front of the security guardsthat hold back the gathered spectators. In a similar fashion, aproscenium arch was erected to frame a garden perspective thatserved as the living backdrop for both a ballet and a play, whichwas given on the second day of the f&#x00EA;te.",
    "short": "Israél Silvestre's Fétes de Versailles",
