        "sub": ["Palace of Queluz, near Lisbon. Designed by Mateus Vicente de Oliveira, 1747-52. In addition to its elaborate parterres of box with Rococo fountains and statuary, the garden has a long Dutch-style canal. The Rococo azulejo panels lining it depice shipping scenes."],
