    "id": "254",
    "graphic": "CH6_036.jpg",
    "desc": "6.33. Quinta da Balcalhoa, Arr&#x00E1;bida Peninsula south ofLisbon. 1528&#x2013;54. This garden was built after the property wasacquired by Braz de Albuquerque, thesoldier and mariner who conquered Goa. Itwas restored in the middle of the twentieth century by its Americanowner, Mrs. Herbert Scoville and nowoffers the best example of a Portuguese Renaissance garden. Thetiles decorating the pavilions beside the water tank encapsulate theearly development of azulejo design in Portugal, showing the transition fromabstract Islamic patterns to Spanish Renaissance pictorialones.",
    "short": "Quinta da Balcalhoa, Arrábida Peninsula",
