    "chp": "06",
    "id": "255",
    "graphic": "CH6_037.jpg",
    "desc": "Left: 6.34. Pal&#x00E1;cio dos Marquesesde Fronteira, Lisbon, Portugal. Built forthe first marquess of Fronteira, Jo&#x00E3;o Mascarenhas, who freedPortugal from Spanish rule, theseventeenth-century palace garden is in the Mannerist syle of thepreceding century. It has a box maze laid out according to a patternof 1628 by the German garden designer Joseph Futtenbach. Within this maze are fiveoctagonal water tanks. A long tank flanked by a 15-foot (4.6-meter)high wall inset with three grottoes and fifteen blind arches isdecorated with blue-and-white tile panels depicting knights onprancing steeds.",
    "short": "Palácio dos Marquesesde Fronteira, Lisbon, Portugal",
