    "id": "324",
    "graphic": "CH7_049.jpg",
    "desc": "Below: 7.47. Jefferson's plan for the University of Virginia as drawn by John Neilson, engraving by Peter Maverick, 1822. This document depicts Jefferson's original interior of the Rotonda as three oval chambers. It also shows the progressively increasing width of the gardens outlined by serpentine walls running between the pavilions and the dormitories. This resulted from Jefferson's desire to counteract optical foreshortening by incrementally lengthening the distance between the pavilions on either side of the lawn to accommodate the perspective along the central axis from the vantage point of the Rotunda.",
