    "id": "376",
    "graphic": "CH9_004.jpg",
    "desc": "9.3. \"The Polyprosopic Hothouse,\" one of the sketches by John Claudius Loudon of various methods of designing glasshouses, from A Treatise on the Theory and Practice of Landscape Gardening. According to Loudon, \"The Polyprosopic Hot-house resembles a curvilinear house, but differs in having the surface thrown into a number of faces, the chief advantages of which are, that by hinging all the different faces at their upper angles, and by having rods connecting the lower outside corners of the faces terminating in chains, which go over pulleys in the top or above the back wall, the whole roof, including the ends, may be opened or raised sympathetically, like Venetian blinds, either so as each sash or face may be placed in the plane of the angle of the sun's rays at the time, or to the perpendicular, to admit a shower of rain.\"",
