    "chp": "12",
    "id": "505",
    "graphic": "CH12_008.jpg",
    "desc": "12.6. Domestic quarter, UneCit&#x00E9; Industrielle. The strippeddown appearanceof Garnier's houses did not mean a banishment of ornament andcolor, only a more neutral background to heighten the expressivepotential of freestanding works of art than was the case whendecoration was conceived as integral with architecture. Garnierfelt that the use of poured concrete and cement resulted in\"large horizontal and vertical surfaces, endowing the buildingswith a sense of calm and balance in harmony with the naturalcontours of the landscape.\" He established a web of connectingfootpaths independent of the street system throughout the entiretown so as to create \"a huge park, free of enclosures andbarriers delimiting individual plots of land.\"",
    "short": "Domestic quarter, Une Cité Industrielle",
