    "graphic": "CH13_012.jpg",
    "desc": "13.11. Christopher Tunnard's house at St. Ann'sHill, Chertsey, Surrey. The drawing by Gordon Cullen showsTunnard's functional, empathie, and artistic approach tolandscape design. Humans and nature meet on friendly, equalterms, and, according to Tunnard's caption in Gardens in the Modern Landscape, this is \"anarchitectural garden, part axial, part asymmetrical,\" in which\"screen walls frame distant views. A sheltered position allowsmany halfhardy subjects to be grown, including cordylines andthe chamaerops palm. The sculpture on the right of the sketch isby Willi Soukop.\" Particular attention has been given to theframing of distant views.",
    "short": "Tunnard's House, St. Ann's Hill, Chertsey, Surrey",
