    "chp": "15",
    "id": "594",
    "graphic": "CH15_017.jpg",
    "desc": "Below: 15.16. Observatory, Oostelijk (East) Flevoland, theNetherlands, designed by Robert Morris. 1971, reconstructed 1977.Influenced by archaeology and by the phenomenology of Frenchphilosopher Maurice Merleau-Ponty, Morris emphasized theexperiential participation of the viewer who comprehends differentscales of time through walking in and around this 300-foot-diameter(91.4-meterdiameter) Earthwork of concentric mounds, embankments,and canals. These different scales of time include the actual timespent on the site, prehistoric time as symbolized by itsarchaeological form, and cosmological time as referenced by Morris'ssolar solstice sight lines.",
    "short": "Observatory, Oostelijk (East) Flevoland, Netherlands",
    "match": null,
